description:
The Beatles' Hits EP was released 6 September 1963. It is The Beatles second British EP and was only released in mono, with the catalogue number Parlophone GEP 8880. It is named The Beatles' Hits because the songs on the album are hit singles (with a B-Side as an addition). Because of this, the EP can be seen as an early greatest hits release. It was also released in Australia and New Zealand.

Track Listing [320k MP3]

All songs were written by Paul McCartney and John Lennon.

